import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import styles from "./Navigation.module.scss";

import Link from "next/link";

function Navigation() {
  return (
    <Navbar expand="lg" className={styles.Nav}>
      <Navbar.Brand href="#home">
        <Link href="/">
          <a className={styles.Nav__logo}>Gregg Fine Web Dev</a>
        </Link>
      </Navbar.Brand>
      <Navbar.Toggle
        aria-controls="basic-navbar-nav"
        className="bg-light"
      />
      <Navbar.Collapse
        id="basic-navbar-nav"
      >
        <Nav className="mr-auto" style={{ backgroundColor: "orange" }}>
          <Link href="/portfolio">
            <a className={styles.Nav__listitem}>Portfolio</a>
          </Link>
          {/* <Link href="/services">
                <a className={styles.logo}>Blog</a>
              </Link> */}

          <Link href="/contact">
            <a className={styles.Nav__listitem}>Contact</a>
          </Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default Navigation;
